import {
  StyleSheet,
  Text,
  View,
  Image,
  Picker,
  Switch,
  CheckBox,
  ImageBackground,
} from "react-native";

export default function App() {
  return (
    <View style={styles.container}>
      <View style={{ flexDirection: "row" }}> //Poner imagenes una frente a la otra
        <Image
          source={require("./images/Futbol_1.jpg")}
          style={{
            width: 150,
            height: 150,
            borderRadius: 10,
            borderColor: "black",
            borderWidth:2,


          }}
        />
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
});
